import React from 'react';
import logo from './logo.png';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <p>Scova</p>
      </header>
      <div className="App"><img src={logo}  alt="logo" /></div>
    </div>
  );
}

export default App;
